INSERT INTO `tblposts` VALUES (1,1,'AVVISO','avviso','<p>AVVISO:</p>\r\n<p>Per tutte le comunicazioni relative ai sevizi di vigilanza utilizzare esclusivamente la seguente e-mail:</p>\r\n<p>serviziggv@provincia.rimini.it</p>',1,NULL,'2018-08-06 07:39:35','2019-09-03 07:20:34'),(2,1,'Auguri','Auguri','<p><strong>I miei pi&ugrave; sentiti Auguri di Buon Natale e Felice Anno Nuovo a tutti Voi e alle vostre famiglie</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Maurizio Guidi</strong></p>',1,'2019-01-17 09:11:54','2018-12-18 16:19:03','2019-01-17 09:11:54'),(3,1,'Riunione annuale GGV 2019','22/08/219 ore 20.30','<p>Il giorno 22 agosto 2019, alle ore 20.30, presso la sala Marvelli nella sede provinciale di Via Dario Campana, 64 a Rimini, si terr&agrave; la riunione annuale delle Guardie Venatorie Volontarie in previsione dell\'apertura della stagione venatoria 2019-20</p>',1,'2019-09-03 07:21:01','2019-08-14 07:32:31','2019-09-03 07:21:01');
/*!40000 ALTER TABLE `tblposts` ENABLE KEYS */;
