 ','ittica lago incal sistem laghi della cina lago v peep',' ',0,NULL,NULL,NULL),(859,918,10,'2015-01-11 07:00:00','2015-01-11 11:00:00',' ','ittica  lago v peep marecchia acque A e B',' ',0,NULL,NULL,NULL),(860,1085,10,'2015-01-25 07:00:00','2015-01-25 10:00:00',' ','ittica ponte messa casteldelci  marecchia',' ',0,NULL,NULL,NULL),(861,1080,13,'2015-01-25 06:00:00','2015-01-25 12:00:00','','Servizio cominciato alle ore 07:00, assieme alle Guardie Ecozoofile Fabbri Stefano, Briganti Manuel e Montanari Giuliano, ci siamo portati nelle adiacenze dell’Oasi di Montebello (Torriana), per verificare la presenza di attività venatoria all’interno della stessa, precisamente sotto l’Eremo della Madonna di Saiano a monte di Via Sabioni.\nTale servizio si rendeva necessario, poichè, diversi giorni fa, abbiamo ricevuto, in forma anonima, la segnalazione di spari presumibilmente in zona interdetta all\'attività venatoria.\nDopo aver monitorato la parte che ritenevamo potesse essere interessata da potenziali bracconieri, con l’ausilio di due binocoli, e constatando l’assenza di attività, decidevamo di effettuare un sopralluogo portandoci fisicamente all’ interno dell’Oasi.\nDurante la verifica della zona di nostro interesse, notavamo evidenti segni del passaggio di ungulati.\nProseguendo il controllo, sempre all’ interno dell’oasi, trovavamo un bossolo esploso (RC40 semi magnum cal. 12), segno evidente di precedente  attività venatoria.\nRaccolto il bossolo, per evitare che lo stesso inquinasse ulteriormente il terreno, decidevamo di proseguire il controllo circa la possibile presenza di altri bossoli.\nTrovandoci nelle adiacenze di una casa diroccata, sita in Via Sabioni in zona Fonte Buona, l’Agente Fabbri Stefano notava, occultato tra le sterpaglie, una scatola di plastica avvolta nel cellophane contenente N. 06 bossoli inesplosi.\nDecidevamo così di contattare l’utenza telefonica n. 335/459743 appartenente al Comandante della Polizia Provinciale Dott. Maurizio Guidi, che a sua volta girava la segnalazione alla pattuglia di turno.\nGiunti sul posto, l\' Isp. Casadio Davide e l\' Ass.te Sc. Protti Ilaria procedevano a prendere in consegna i 6 bossoli inesplosi e ad effettuare il verbale di rinvenimento (che si allega).','Nissan Patrol Proprietario Giuliano Montanari',0,NULL,NULL,NULL),(862,1086,11,'2014-12-06 06:00:00','2014-12-06 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(863,1087,11,'2014-12-07 06:00:00','2014-12-07 10:00:00',' ',' ',' ',0,NULL,NULL,NULL),(864,1088,11,'2014-12-07 05:30:00','2014-12-07 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(865,1089,11,'2014-12-07 09:00:00','2014-12-07 12:00:00',' ',' ',' ',0,NULL,NULL,NULL),(866,1090,11,'2014-12-08 06:30:00','2014-12-08 10:00:00',' ',' ',' ',0,NULL,NULL,NULL),(867,1091,11,'2014-12-10 12:30:00','2014-12-10 18:00:00',' ',' ',' ',0,NULL,NULL,NULL),(868,1093,11,'2014-12-17 06:00:00','2014-12-17 14:00:00',' ',' ',' ',0,NULL,NULL,NULL),(869,1094,11,'2014-12-17 12:30:00','2014-12-17 17:30:00',' ',' ',' ',0,NULL,NULL,NULL),(870,661,11,'2014-11-29 06:00:00','2014-11-29 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(871,1095,11,'2014-11-02 05:30:00','2014-11-02 11:30:00',' ',' ',' ',0,NULL,NULL,NULL),(872,1096,11,'2014-11-02 06:00:00','2014-11-02 10:00:00',' ',' ',' ',0,NULL,NULL,NULL),(873,1097,11,'2014-11-02 06:00:00','2014-11-02 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(874,1098,11,'2014-11-05 13:00:00','2014-11-05 17:00:00',' ',' ',' ',0,NULL,NULL,NULL),(875,1099,11,'2014-11-09 05:30:00','2014-11-09 11:30:00',' ',' ',' ',0,NULL,NULL,NULL),(876,1100,11,'2014-11-12 12:30:00','2014-11-12 17:30:00',' ',' ',' ',0,NULL,NULL,NULL),(877,1101,11,'2014-11-16 06:00:00','2014-11-16 12:00:00',' ',' ',' ',0,NULL,NULL,NULL),(878,1102,11,'2014-11-19 12:30:00','2014-11-19 17:00:00',' ',' ',' ',0,NULL,NULL,NULL),(879,1103,11,'2014-11-20 06:00:00','2014-11-20 10:00:00',' ',' ',' ',0,NULL,NULL,NULL),(880,1104,11,'2014-11-23 05:30:00','2014-11-23 11:30:00',' ',' ',' ',0,NULL,NULL,NULL),(881,1105,11,'2014-11-26 12:30:00',