udio Papini, responsabile oasi WWF Cà Brigida e Stefano Chiti direttivo WWF Rimini','Controllato minuziosamente una vasta porzione di territorio in comune di Verucchio di proprietà del WWF Italia, precisamente in località Bruciato di Sopra. \nIl servizio si è reso necessario in quanto un intervento abusivo con mezzo meccanico in zona vincolata, sul quale indaga il CFS, ha permesso di evidenziare come in zona vi fossero realistici motivi per ritenere che nell\'area si svolgessero attività di prelievo venatorio non autorizzato di fauna selvatica, con l\'ausilio di mezzi non consentiti.\nL\'operazione ha permesso di rinvenire una gabbia trappola per mammiferi, composta da due corpi separati uniti fra loro e dotata di un sistema di scatto basculante per la quale si è proceduto con la stesura di un sequestro amministrativo contro ignoti.\nAl momento del controllo la trappola è risultata funzionante ma non atta alla cattura, in quanto priva di qualsiasi tipo di esca attrattiva. Ogni tentativo di risalire al proprietario è fallito, anche se una serie di indizi fanno protendere per la responsabilità di una persona residente in loco e per la quale veranno istruiti servizi mirati anche nei prossimi mesi.','Multipla associazione Maricla targa CZ816BP',0,NULL,NULL,NULL),(1028,1254,8,'2015-02-21 13:00:00','2015-02-21 18:00:00','--','svolto servizio nella zona di Faetano Mulazzano più Oasi di Protezione Torriana Montebello. Nulla da segnalare-','AUTO  DI TONINI TG. BJ 395 SA KM 93',0,NULL,NULL,NULL),(1029,1313,13,'2015-03-07 07:00:00','2015-03-07 11:00:00','Nulla da segnalare','Controllo Parco Papa Giovanni Paolo II.\nIdentificate n 4 persone in esercizio di pesca.\n1) Montanari Gianluca nato a Cesena il 5/4/83 licenza di pesca numero 755195 rilasciata dal Comune di Montiano (FC)\n2) tribunale Marco nato a Cesena il 31/3/80 licenza numero 758807 rilasciata dal Comune di Rimini\n3) Modeo Andrea nato a Cesena il 19/10/87 licenza di pesca numero K66327 rilasciata dal Comune di Rimini\n4) cappelli Manuel nato a Cesenatico Il 20/1/81 carta d\'identità numero AV5036897.','Nissan Terranova AY132DN',0,NULL,NULL,NULL),(1030,564,13,'2014-11-16 06:30:00','2014-11-16 11:30:00','--','effettuato servizio di controllo alla pesca di frodo. nessun riscontro','--',0,NULL,NULL,NULL),(1031,1319,13,'2015-03-14 08:00:00','2015-03-14 11:00:00','Null\' altro da segnalare','Servizio ittico e ambientale svolto congiuntamente alle Guardie Ecozoofile Fabbri Stefano e Giustolisi Claudio Dario. \nControllo ittico al Lago Mariotti (Parco Papa Giovanni Paolo II).\nControllate 3 ersone in esercizio di Pesca:\n1) Bersani Luca nato a Rimini il 01/07/95 (Patente di Guida RN5197263D da MCTC-RN;\n2) Capelli Omar nato a Rimini il 30/11/1995 ( Carta d\' Identità AT0938248 Rilasciata da Comune di Rimini;\n3) Iaccarino Andrea nato a Cesena il 29/06/1993 ( Carta d\' identità n° AI 22535610 Rilasciata da Comune di Savignano sul Rubicone)\nIl servizio è terminato alle ore 11:45.','Auto Mercedes A180 (Classe A) targata DB757RB',0,NULL,NULL,NULL),(1032,1321,13,'2015-03-14 12:45:00','2015-03-14 15:00:00','NULL\' ALTRO DA RILEVARE.','Controllo Ittico insieme a Cunti Manuel presso il Fiume Marecchia ( Parco XXV Aprile ) . Identificata una persona in esercizio di pesca.\n1) Cai XI nato a Zhejiang ( Repubblica Cinese) il 04/12/1983. Patente di Guida RN5109944C Rilasciata il 12/12/2006 da MCTC - RN.\nDurante la prosecuzione del nostro controllo, mentre ci trovavamo a piedi sul perscorso storico Naturalistico della Valmarecchia e più precisamente fronte alla Via Capelli, notavamo un veicolo avente due ruote tipo minimoto, ma non meglio identificabile che circolava sul percorso storico - naturalistico.\nIl conducente di detto veicolo, notandoci si accostava. Procedevo così a chiedere le sue generalità, e il soggetto me le indicava, specificando però che non era in possesso di alcun tipo di documento di riconoscimento. Contattavo così la Polizia Municipale di Rimini, i quali mi riferivano di non avere pattuglie disponibili in quanto c\' era una manifestazione in corso, ma che avrebbe informato la Questura di Rimini.\nInterveniva così sul posto una pattuglia della Squadra Volante della Questura, per identificare il soggetto in quanto straniero e senza documenti al seguito.\nLa pattuglia della Questura, lo identificava così in Karbula Oleg C.F. KRBLGO82B23Z138G nato in Ucraina (UKR) il 23/02/1982 e residente a Rimini in Via Lucio Lando, 57 ( Perm. di Soggiorno I05660176 rilasciato dalla Questura di Rimini in data 07/05/2014. Interveniva così sul posto, su richiesta della Squadra Volante, una pattuglia della Polizia Stradale di Riccione, per la contestazione delle violazioni alle norme del Codice della Strada. Io procedevo quindi a verbalizzare la violazione al Decreto del Presidente della Provincia di Rimini n° 30/2006. Il servizio si è prolungato fino alle ore 18:00.','Fiat New Panda targata ET966BV',0,NULL,NULL,NULL),(1033,1322,3,'2015-01-06 05:00:00','2015-01-06 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(1034,1323,3,'2015-01-07 05:00:00','2015-01-07 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(1035,1324,3,'2015-01-14 05:00:00','2015-01-14 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(1036,1167,10,'2015-02-18 13:30:00','2015-02-18 16:00:00',' ','ittica  lago della cava',' ',0,NULL,NULL,NULL),(1037,1168,10,'2015-02-19 13:30:00','2015-02-19 16:30:00',' ','ittica   lago della cava ponte di legno',' ',0,NULL,NULL,NULL),(1038,1169,10,'2015-02-22 13:30:00','2015-02-22 16:30:00',' ','ittica bellaria poggio berni ponte verucchio uso marecchia',' ',0,NULL,NULL,NULL),(1039,1170,10,'2015-02-28 07:30:00','2015-02-28 10:30:00',' ','ittica laghi zaganti marecchia ponte verucchio laghi della cina',' ',0,NULL,NULL,NULL),(1040,1285,10,'2015-03-03 14:00:00','2015-03-03 17:00:00',' ','ittica ponte di legno marecchia uso',' ',0,NULL,NULL,NULL),(1041,1286,10,'2015-03-02 07:00:00','2015-03-02 11:00:00',' ','ittica lago zaganti ponte verucchio',' ',0,NULL,NULL,NULL),(1042,1287,10,'2015-03-