NULL,NULL),(1136,1666,4,'2015-09-03 04:00:00','2015-09-03 12:00:00','CONTROLLI 03-09-2015							\n	Cognome	Nome	nato a:	il	Residente	indirizzo	Porto D\'Armi\n1	Bezzi	Roberto	Rimini	18/06/44	Rimini	Via G. Broglio n. 11	676176-N\n2	Marzaloni	Maurizio	Rimini	04/05/69	Verucchio	Via Berlinguer 16	246729-O\n3	Solferino	Vincenzo	Sassano (SA)	27/01/50	Rimini	Via Linaro 27	247095-O\n4	Solferino	Mino	Rimini	10/03/58	Rimini	Via Cotignola 6	694356-M\n5	Caldari	Otello	Rimini	24/01/41	Rimini	Via Urano 43	693517-M\n6	Coccia	Massimiliano	Rimini	11/02/69	Rimini	Via Padulli 75	694336-M\n7	Casadei Coccia	Gianfranco	Rimini	16/10/45	Rimini	Via Delle Cascine 25L	246826-O','Controlli principalmente concentrati nel comune di Rimini, lungo l\'asta fluviale del fiume Marecchia. \nIn zona frantoio Pesaresi sono state riscontrate diverse situazioni irregolari e diversi comportamenti illeciti. Accertato l\'abbattimento di specie nei cui confronti la caccia era vietata e precisamente colombacci e anatidi.\nUn lungo appostamento degli agenti di pattuglia ha consentito di individuare due cacciatori responsabili dell\'abbattimento di un esemplare di Germano Reale. Entrambi sono stati denunciati all\'autorità giudiziaria dopo l\'intervento degli agenti della Polizia Provinciale chiamati sul posto.\nNon è stato possibile individuare gli autori degli altri abbattimenti illeciti.\nDa segnalare come al controllo degli agenti, il sig. Marzaloni Maurizio abbia opposto resistenza alla consegna dei documenti di caccia ai medesimi, e solo in un secondo momento si sia deciso di esaudire le legittime richieste degli agenti per non incorrerre in sanzioni.','Associazione Maricla Multipla CZ816BP',0,NULL,NULL,NULL),(1137,1674,4,'2015-09-06 04:00:00','2015-09-06 11:30:00','Zona nord',' ',' ',0,NULL,NULL,NULL),(1138,1653,5,'2015-09-06 03:30:00','2015-09-06 12:00:00',' controllato n. 16 cacciatori  comuni di coriano , misano , s. clemente .','vigilanza venatoria in giornata di caccia da appostamento / in servizio dalle 4\'30 alle 13\'00.','panda gev  targa dh 274hj percorsi km 45',0,NULL,NULL,NULL),(1139,1654,5,'2015-09-10 04:30:00','2015-09-10 12:00:00',' località in cui si è effettuato servizio -- cella simboni -s.andrea in b.- i balconi - ospedaletto - m. tauro ---','vigilanza venatoria in giorno di preapertura da appostamento. comuni di coriano, misano m. ,s. clemente . giornata con pochi cacciatori rispetto alle giornate precedenti. anche x taglio di numerosi appezzamenti di girasoli. servizio dalle 5\'30 alle 13\'00.',' panda 4x4 gev.  di riccione . km. percorsi 59',0,NULL,NULL,NULL),(1140,1654,5,'2015-09-10 04:30:00','2015-09-10 12:00:00',' sevizio in località cella - forte bill . s. andrea in b.- ospedaletto - monte tauro ---','vigilanza venatoria in giornata di preapertura da appostamento- pochi cacciatori sul territorio rispetto alle giornate precedenti, anche per taglio di numerosi appezzamenti di terreno coltivati a girasole . controllati 7 cacciatori nei comuni di misano m. san clemente. coriano -- servizio dalle 05,30 alle 13,00--','panda gev 4x4 di riccione - targa dh 274 mj km percorsi 59--',0,NULL,NULL,NULL),(1141,1675,4,'2015-09-10 04:30:00','2015-09-10 10:00:00','CACCIATORI CONTROLLATI\nCognome	Nome	    nato a:	                il	       Residente	          indirizzo	                             Porto D\'Armi\nRossi	Iader	Santarcangelo	      19/05/63	  Rimini	       Via Salvo D\'Acquisto 5	      694136-M\nRossi	Alessandro	Rimini	     04/10/96	       Rimini	Via Salvo D\'Acquisto 5	       246699-O\nRinaldini	Daniele	        Rimini	      25/05/45    	Rimini	Via E. Coletti 146             	693302-M','Controllati alcuni appostamenti di caccia zona Rimini Nord, località Torre Pedrera.\nIndividuato due cacciatori esercitare l\'attività venatoria da uno storico appostamento fisso non più rinnovato. Dopo lungo e accurato controllo veniva contestato loro la caccia in appostamento fisso senza autorizzazione. Elevate due contestazioni di illecito amministrativo nei confr