ingillidi.\nNella mattinata odierna, dopo un appostamento di oltre due ore, si è assistito all\'abbattimento di due merli ed una tortora, nessuna azione è stata esercita nei confronti di specie protette.\nL\'occupante, tale Antolini Gabriele, ha negato nella maniera più assoluta ogni tipo di responsabilità nel rinvenimento del piumaggio appartenente a specie nei confronti di specie non consentite, ma gli indizi rinvenuti lasciano pochi dubbi sull\'accaduto nelle giornate precedenti. L\'occupante è persona conosciuta dagli agenti e noto cacciatore per anni di piccoli uccelli. Ulteriori controlli saranno esercitati nei prossimi mesi.\nAlle 8:30 gli agenti Bruni lasciano il servizio che viene continuato dagli agenti Re e Bruschi fino alle 10:30','Associazione Maricle Onlus CZ 816 BP',0,NULL,NULL,NULL),(1151,1687,4,'2015-09-20 04:30:00','2015-09-20 11:30:00','CONTROLLI 20-09-2015							\n	Cognome	               Nome	nato a:	               il	          Residente	                 indirizzo	                                    Porto D\'Armi\n	Baietti	        Giuseppe	       Rimini	                 10/02/45	              Rimini	                  Via Antonio Abetti 15/C	               247422-O\n        De Carli	          Alberto	       Rimini	                  03/02/39	       Rimini	           Via Maderna 2/H	                       952116-N\n	Saccomanni	    Mario	     Piandimeleto (PU)	19/10/54	               Rimini	          Via Negri 6	                                 675824-N\n	Broccoli	             Adriano	Rimini	                10/06/44	               Rimini	            Via Flavia Casadei 12	                 693382-M\n	Rossi	            Claudio	Rimini	                15/02/66	               Rimini	            Via Carpi 5/B	                           676864-N\n	Valentini	         Giuseppe	Sant\'Agata Feltria (PU)	26/06/43	   Santarcangelo di Rom.	Via trasversale Marecchia 3283   246751-O\n	Rossi	          Guerrino	Montecopiolo (PU)	         20/01/43	       Rimini	               Via Contenti 8	                             694525-M','Giornta di apertura generale della caccia, vigilanza nel comune di Rimini, Verucchio, Santarcangelo, Bellaria -Igea M. \nPresenza di cacciatori nutrita ma pochi colpi uditi, molti controlli esercitati dagli agenti con l\'ausilio del binocolo lungo la via Santa Cristina, e la discarica di Cà Baldacci, qualche verifica dei documenti a campione sui tanti che circolavano.\nIn tarda mattinata controlli spostati più versa la pianura, nella Tenuta Benelli nel comune di Bellaria Igea M.\nNon rilevato situazioni di illecito tali da essere contestate','Associazione Maricla Onlus CZ 816 BP',0,NULL,NULL,NULL),(1152,1693,4,'2015-09-27 05:00:00','2015-09-27 11:00:00','CONTROLLI 27-09-2015							\n	Cognome	                        Nome	                     nato a:	                            il	                            Residente	                            indirizzo	                  Porto D\'Armi\n	Andreani	                      Franco	                  Gradara (PU)	                        22/01/37	               Cattolica	                     Via Costituente 57	                   693606-M\n	Bacchini	                      Massimiliano	            Pesaro (PU)	                       14/07/68	             Cattolica	                     Via Delle Ginestre 2	                   951471-N\n	Leardini	                      Agostino	                 San Giovanni in Marignano	19/01/60	            Misano Adriatico	              Via Tintoretto 77	                 694704-M\n	Lorenzi	                      Elio Adamo	         San Giovanni in Marignano	21/06/46	           San Giovanni in Marignano	Via Rossi 1081	                 247084-O\n	Giometti	                      Stefano	                             Rimini	                          10/06/61	     Misano Adriatico	                  Via Rosai 21	                          247147-O','A seguito di una segnalazione ricevuta da un privato è stata programmata un\'uscita a Rimini sud nel comune di San Giovanni in Marignano e nelle zone limitrofe.\nIl forte vento che ha caratterizzato la giornata, non ha consentito di verificare compiutamente la segnalazione per cui prossimamente verranno effettuate altre uscite mirate.\nControlli effettuati su cacciatori dediti alla caccia stanziale e capannisti, hanno fatto evidenziare un solo illecito amministrativo per la mancata apposizione di un capo di abbigliamento ad alta visibilità come prescritto dal calendario venatorio.','Associazione Maricla Onlus Multipla CZ 816 BP',0,NULL,NULL,NULL),(1153,1698,4,'2015-04-21 06:30:00','2015-04-21 12:30:00','Verbale nomina ausiliari PG-Verbale liberazione Fauna selvatica','Intervento effettuato in collaborazione con il Corpo Forestale dello Stato di Morciano presso due distinte abitazioni. Elevate in entrambi i casi sanzioni per illeciti amministrativi e inoltrato due CNR in Procura per cattura di fauna selvatica e detenzione di quest\'ultima. Eseguiti sequestri di diverse trappole e reti da ucellagione.\nIndagati Tonti Romeo e Ferri Siro','Associazione Maricla CZ 816 BP',0,NULL,NULL,NULL),(1154,1699,4,'2015-09-06 04:00:00','2015-09-06 11:30:00','Cognome   Nome          Nato             il                     res.                                           Lic. Caccia\nMussoni Gabriele  Santarcangelo  02-4-57    San Mauro Pascoli-via Botticelli 8    647701-N\nConti Gilberto         Novafeltria     02-10-65  Santarcangelo-via San vito 549         693400-M\nConti Alessandro  Santarcangelo   28-11-70   Santarcangelo-via Amendola 5         676750-N','Seconda giornata di preapertura, in prima mattinata svolta vigilanza nel fiume Marecchia all\'altezza della cava Pesaresi, dove nella prima giornata di caccia diversi appostamenti hanno sparato a specie non cacciabili tra cui anatre e colombacci, entrambi documentati dagli agenti di questo nucleo.\nNella giornata odierna presenti solo due distinti appostamenti di caccia con due occupanti ciascuno, osservati con l\'ausilio dei binocoli e visti abbattere specie consentite tranne in un caso dove i diversi colpi sparati all\'indirizzo di un colombaccio non sono andati a segno.\nSospeso verso le 8.00 il controllo ci si è portati nei comuni di Santarcangelo, Verucchio, Poggio Torriana.\nEffettuati altri controlli a cacciatori ma non rilevato situazioni illecite.','Associazione Maricla CZ 816 BP',0,NULL,NULL,NULL),(1155,1700,4,'2015-09-11 19:00:00','2015-09-11 21:30:00','Non controllati cacciatori','Servizio notturno finalizzato a controllare un\'area situata nei pressi del casello di Rimini Nord.\nIntervento resosi necessario dopo la chiamata di un cittadino che ci segnalava come durante le ore serali un cacciatore del luogo, a bordo del proprio mezzo agricolo in movimento, perlustrava dei campi arati con i fari sparando alle lepri.\nVerso le ore 20.30 si sentiva provenire dai coltivi interessati al controllo un colpo d\'arma da fuoco, ma non si riusciva ad individuarne l\'autore.\nAlla fine del servizio, presso alcune abitazioni di campagna limitrofe, si udiva provenire un secondo colpo d\'arma da fuoco ma la posizione della pattuglia non permetteva di intervenire celermente per individuare l\'autore dello sparo.','Associazione Maricla CZ 816 BP',0,NULL,NULL,NULL),(1156,1701,4,'2015-09-13 04:45:00','2015-09-13 11:00:00','Cognome   Nome          Nato             il                     res.                               Lic. Caccia\nBellavista Paolo   Bellaria-I.M.   12-5-58    Bellaria-I.M.-via Garibaldi 39  694839-M\nBelli Vittorio     Borghi (FC)       13-11-29          Rimini-via Palmyra 5       676395-N\nBoldrini Claudio  Rimini       06-04-57      Bellaria-I.M.-via Battisti 18/A   675062-N','Controllota zona nord della provincia cominciando dal comune di Bellaria Igea-Marina per giungere fino a quello di Rimini, effettuato alcuni appostamenti con l\'intento di osservare il comportamento di alcuni appostamenti di caccia in funzione.\nNon rilevato particolari situazioni che meritino di esser