5:30:00','2015-10-15 10:30:00',' ','Uscita di vigilanza programmata per la zona nord dove si verificava una scarsissima presenza di cacciatori. Si decideva di spostarsi quindi in zona sud, dove uno dei due agenti componenti la pattuglia nella giornata di lunedì aveva udito il suono di un registratore in funzione provenire da un appostamento.\nGiunti nelle vicinanze del capanno da caccia siamo rimasti in ascolto, ma nell\'arco dell\'intero periodo che siamo stati appostati solo per una frazione di pochi secondi si è udito il mezzo veietato in funzione, troppo poco per consentire un intervento concreto. Il tutto è stato quindi rimandato ad un prossimo intervento da programmare prossimamente.','Multipla CZ 816 BP Associazione Maricla ONLUS',0,NULL,NULL,NULL),(1167,1731,4,'2015-10-17 05:30:00','2015-10-17 10:00:00','Cognome         	    Nome	                     nato a:	                     il	                          Residente	                         indirizzo	                  Porto D\'Armi\nMaioli	                Giuseppe         	Misano Adriatico	      16/12/52	              Misano Adriatico	           Via Emilia 71                 	694487-M\nLeardini	                 Aldo	                Montescudo	               07/06/49	             Misano Adriatico	                   Via Carro 94	                       675916-M\nBarogi	             Edgardo	              Misano Adriatico	      25/06/35	             Misano Adriatico	                  Litoranea Nord 21	                 676763-N\nBarilari	           Ermanno	                 Riccione	                     29/04/52	                   Riccione	                 Via Pindemonte 2	                 675218-N','Vigilanza effettuata nella zona sud della provincia in continuità con il servizio di giovedì scorso. I controlli non hanno dato un esito positivo in quanto l\'appostamento di caccia oggetto delle nostre verifiche non era occupato da entrambi i cacciatori visti durante il giorno infrasettimanale.\nEsteso poi i controll