dente a Cesena in Via La Spezia.',' ',0,NULL,NULL,NULL),(1206,1758,4,'2015-11-07 05:00:00','2015-11-07 10:00:00','Cognome	Nome	nato a:	                            il	                    Residente	                     indirizzo	              Porto D\'Armi\nBaldinini	Primo	San Mauro Pascoli FC	  15/12/38	San Mauro Pascoli FC	Via A. Gramsci 7	  647359-N\nGaravelli	Renato	Sogliano al Rubicone FC	  30/03/55	Bellaria-I.Marina	         Via Parenzo 41	   951761-N','Controlli in zona nord della provincia, comuni di Bellaria, Rimini, Santarcangelo. scarsa presenza di cacciatori, due controlli e nessuna segnalazione degna di nota','Associazione Maricla Multipla CZ 816 BP',0,NULL,NULL,NULL),(1207,1761,4,'2015-11-08 05:30:00','2015-11-08 11:00:00','Cognome	Nome	            nato a:	                                  il	              Residente	                 indirizzo	                 Porto D\'Armi\nRomagna	        Fernando	        San Giovanni in Marignano	17/11/44	       Morciano di R.	        Via Venezia 7	          676242-N\nCecchini	        Franco	        Misano Adriatico	                17/09/47	        Misano Adriatico	Via Fagnano 1	          675190-N\nValentini	        Guerrino	        Misano Adriatico	                 06/05/49	        Misano Adriatico	Via Nino Bixio 40	  676120-N','Controlli in zona sud della provincia finalizzati a completare le precedenti uscite. \nEsito non positivo dell\'appostamento mirato nello specifico a verificare la correttezza l\'attività venatoria di un sito di caccia da tempo monitorato. Poi effettuato qualche controllo a campione nelle zone circostanti lungo il Ventena a Morciano, Misano, San giovanni, San Clemente.\nNon riscontrato situazioni particolari e non rilevato condotte illecite','Associazione Maricla Multipla CZ 816 BP',0,NULL,NULL,NULL),(1208,1780,4,'2015-11-14 05:30:00','2015-11-14 10:30:00','Cognome          Nome	      nato a:	                             il	               Residente	                   indirizzo	                               Porto D\'Armi\nGasperini        	Marcello	       Rimini	                            18/02/67	Bellaria-I.Marina	Via Tibullo 14	                       675024-N\nBartolini	        Arnaldo	      San Mauro Pascoli FC	    20/06/38	San Mauro Pascoli	Via L. Da Vinci 10	               647994-N\nRicci	               Giorgio	     Montalto delle Marche AP	   26/08/47	Bellaria-I.Marina	Via Giovanni XXIII 21/A	       675501-N\nOrsini	       Mario	     Lisciano Niccone PG	           26/01/52	Bellaria-I.Marina	Via Rapisardi 18/A	               247169-O\nGualtieri	      Aurelio	     Santarcangelo di Romagna  02/04/37	Bellaria-I.Marina	Via Maffi 3	                       693300-M','Durante alcuni controlli lungo l\'asta fluviale del fiume Uso veniva individuato, in via Donegallia, un gruppo di cacciatori della zona riconosciuti come cacciatori abituali in tali zone. Al controllo si riusciva ad accertare per due di essi l\'esercizio della caccia a distanza non regolamentare da un immobile adibito a ricovero attrezzi e animali da allevamento, nonché un\'abitazione di nuova costruzione ma non ancora accessoriata.\nPer i due in prossimità dell\'immobile, uno dei quali (Orsini) aveva esploso anche un colpo di fucile, veniva contestata la mancata distanza, per il terzo (Ricci), in posizione più distante e posizionato più obliquamente rispetto ai colleghi, per il quale noi agenti non abbiamo rilevato per tempo la posizione, veniva contestata la mancata annotazione della giornata e rilevato la mancata esecuzione della prescrizione di polizia che lo obbligava a cacciare con l\'ausilio delle lenti che egli non indossava.\nSi segnala che durante la contestazione il sig. Orsini da subito si opponeva dando dei prevenuti agli agenti e invitandoli insistentemente a lasciare perdere, alzando il tono di voce battendo la mano sul petto dell\'agente Eros Bruni e da quest\'ultimo poi invitato ad abbassare le mani.\nAnche da parte dei due colleghi di caccia coinvolti giungeva supporto, con richieste di soprassedere alle contestazioni che invece venivano regolarmente effettuate dagli agenti.\nFinite le contestazioni la nostra pattuglia si spostava per poi ripassare in zona, dove il trio di cacciatori si era unito ad un quarto cacciatore locale da noi ben conosciuto. Contestualmente il cacciatore del gruppo precedentemente sanzionato ed identificato come Gualtieri, faceva segno agli agenti di fermarsi inveendo verso di loro per il fatto di aver contestato al loro collega una sanzione minore e di non aver contestato la distanza che secondo egli non era regolare. A quel punto l\'agente Bruschi, spiegato inutilmente la motivazione della mancata contestazione, e preso atto della te','Associazione Maricla Multipla CZ 816 BP',0,NULL,NULL,NULL),(1209,1783,3,'2015-09-20 05:00:00','2015-09-20 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(1210,1784,3,'2015-09-18 15:30:00','2015-09-18 19:30:00',' ',' ',' ',0,NULL,NULL,NULL),(1211,1785,3,'2015-09-11 15:30:00','2015-09-11 19:30:00',' ',' ',' ',0,NULL,NULL,NULL),(1212,1786,3,'2015-06-14 05:00:00','2015-06-14 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(1213,1787,3,'2015-07-31 15:30:00','2015-07-31 19:30:00',' ',' ',' ',0,NULL,NULL,NULL),(1214,1789,3,'2015-07-23 15:30:00','2015-07-23 19:30:00',' ',' ',' ',0,NULL,NULL,NULL),(1215,1790,3,'2015-07-21 15:30:00','2015-07-21 20:30:00',' ',' ',' ',0,NULL,NULL,NULL),(1216,1791,3,'2015-07-19 07:00:00','2015-07-19 12:00:00',' ',' ',' ',0,NULL,NULL,NULL),(1217,1792,3,'2015-07-07 15:30:00','2015-07-07 20:30:00',' ',' ',' ',0,NULL,NULL,NULL),(1218,1795,4,'2015-10-31 04:30:00','2015-10-31 11:00:00','Cacciatori controllati:\n\nCognome  Nome       Nato a:            il:              Residente         Indirizzo                     P. d\'armi\nSalvatori  Fabrizio    Santarcangelo  31/10/67   Rimini            Via Teodorico 17/H     952312-N\nZangoli    Bruno       Verucchio         07/12/40   Verucchio        Via Pascoli 93            676809-N\nZangoli    Giovanni   Verucchio        12/05/40    Verucchio       Via Casale 13             676796-','Servizio svolto nei comuni di Bellaria, Santarcangelo, Poggio Torriana, Verucchio, Rimini. In località Ciola Corniale sorpreso un cacciatore mentre abbatteva un esemplare di specie protetta e inoltre venivano contestate a suo carico una serie di violazioni di carattere amministrativo. In tale occasione interveniva per le operazioni di sequestro il corpo forestale dello stato.','Associazione Maricla CZ 816 BP',0,NULL,NULL,NULL),(1219,1796,4,'2015-11-01 04:00:00','2015-11-01 11:00:00','Cacciatori controllati:\n\nCognome    Nome      Nato a:             il:             residente:              Indirizzo:                P. D\'armi\nBagagli     Luciano   Sogliano al R.  05/11/46   Savignano sul R. Via F.lli Spazzoli 4   647829-N\nBrigliadori  Gilberto Savignano sul R. 20/02/67    Borghi            Via Brandolini 125   141134-O\nBronzetti    Enrico     Rimini               24/05/56     Rimini            Via O. Antinori  24   246535-O','Servizio svolto nei comuni di Bellaria, Santarcangelo, Poggio Torriana, Verucchio, Rimini. Effettuato diversi controlli, anche lungo la sponda Sx orografica del Marecchia, che non non hanno fatto riscontrare situazioni illecite. Da segnalare come il nuovo percorso storico naturalistico su sponda Sx orografica del Marecchia evidenzi danni dovuti al transito di moto da fuoristrada, la situazione necessita un intervento urgente per contenere il fenomeno.','Associazione Maricla CZ 816 BP',0,NULL,NULL,NULL),(1220,1797,4,'2015-11-15 05:30:00','2015-11-15 10:00:00','Cacciatori controllati:\n\nCognome  Nome       Nato a:       il:            Residente                Indirizzo                 P. d\'armi\nVignali     Andrea    Rimini       22/07/60   Acquaviva RSM   Via E. Notaio 17     05050/B RSM\nVeroli      Sergio     Verucchio    20/01/50       Rimini              Via Bondeno 7           246107-O','Servizio svolto nei comuni di Bellaria, Santarcangelo,Verucchio, Rimini. \nIn prima mattinata per