ritoriale: Comune di Cattolica, Comune di Misano Adriatico\n\nIl servizio di vigilanza aveva luogo in Comune di Cattolica dalle ore 14,00 del 12-02-16 ad opera delle sopraccitate guardie ittiche Walter Cantasale (Accademia Kronos) e Fabio Re (WWF Italia) assistiti dalla Guardia eco-zoofila Antonio Citro (Accademia Kronos).\nVenivano ispezionati in primo luogo gli argini fluviali del fiume Tavollo in Comune di Cattolica, nella zona prospiciente la foce a mare di pertinenza dell’abitato e degli squeri dedicati allo stazionamento dei mezzi natanti ivi custoditi.\nDal sopralluogo emergeva il ritrovamento di alcuni depositi di inerti e alcuni frammenti di materiale sospetto, probabilmente riconducibile a lastre sbriciolate di cemento-amianto. Tale materiale era sparso come sedime della pista di passaggio adibita al transito dei carrelli di trasporto dei natanti.\nAcquisito materiale fotografico di tali ritrovamenti, ci si dirigeva presso la foce del fiume Conca in Comune di Misano Adriatico laddove veniva rinvenuta nelle immediate pertinenze della foce l’istallazione abusiva di un capanno stabile adibito probabilmente al ricovero attrezzi di pesca e/o stazionamento, realizzato con materiali naturali mimetici e tondini di ferro. Venivano ritrovate tracce di lenze nelle pertinenza del capanno che risultava comunque inidoneo allo scopo venatorio o di osservazione faunistica.\nSull’argine destro del fiume, in Comune di Cattolica, nel tratto compreso fra il ponte stradale, il parcheggio comunale e i primi 500 metri circa di pista ciclabile, venivano invece scoperti molti bivacchi e ricoveri notturni e diurni, diversi depositi di rifiuti anche pericolosi abbandonati in quantità r',' ',0,NULL,NULL,NULL),(1689,2105,4,'2016-02-23 13:00:00','2016-02-23 17:00:00',' ','Relazione servizio di vigilanza ittica congiunta – Accademia Kronos – WWF Italia\nData e orari di svolgimento del servizio: 23 febbraio 2016 dalle ore 14 alle ore 18,00\nGuardie ittiche: Walter Cantasale (Accademia Kronos) Fabio Re (WWF Italia) \nGuardie eco-zoofile: Omar Antonioli (Accademia Kronos)\nAllievi aspirante guardie: Giuseppe Romano (Accademia Kronos)\nAmbito territoriale: Comune di Cattolica, Comune di Misano Adriatico, Comune di Riccione\n\nIl servizio di vigilanza aveva luogo in Comune di Cattolica dalle ore 14,00 del 23-02-16 ad opera delle sopraccitate guardie ittiche Walter Cantasale (Accademia Kronos) e Fabio Re (WWF Italia) assistiti dalla Guardia eco-zoofila Omar Antonioli (Accademia Kronos) alla presenza dell\'allievo aspirante guardia Giuseppe Romano (Accademia Kronos).\nVenivano ispezionati in primo luogo gli argini fluviali del fiume Tavollo in Comune di Cattolica, nella zona prospiciente la foce a mare di pertinenza dell’abitato e degli squeri dedicati allo stazionamento dei mezzi natanti ivi custoditi.\nCi si dirigeva in un secondo momento presso la foce del fiume Conca in Comune di Cattolica, nel tratto compreso fra il ponte stradale, il parcheggio comunale e i primi 800 metri circa di pista ciclabile. Veniva riscontrata quindi la persistenza dello stato di degrado e abbandono di rifiuti nella zona nonché la persistenza dei diversi accampamenti e discariche abusive delle quali, durante il servizio di vigilanza del 12-02-16 si era data dettagliata denuncia agli organi competenti.\nInfine si procedeva all\'ispezione della foce fluviale del Torrente Marano in Comune di Riccione interessato dalle operazioni di drastica riduzione della vegetazione ripariale avvenuta ad opera di STB nelle settimane precedenti. Ivi si constatava lo stato di degrado del sito per la permanenza in loco di considerevoli ammassi di rifiuti e il complessivo impoverimento dell\'habitat a causa degli impatti conseguenti ai massicci lavori di asportazione del canneto ripariale.\nDi tut',' ',0,NULL,NULL,NULL),(1690,2154,11,'2015-12-16 05:00:00','2015-12-16 12:00:00',' ',' ',' ',0,NULL,NULL,NULL),(1691,2155,11,'2015-12-27 06:00:00','2015-12-27 11:00:00',' ',' ',' ',0,NULL,NULL,NULL),(16