            Riccione	                     Via Piemonte 6	                      951870-N\nCevoli	            Giancarlo	          Rimini	                                    15/02/50	             Riccione	                     Via Mondovì 6	                      246494-O\nCevoli	            Pierpaolo	          Rimini	                                     24/07/47	             Riccione	                     Via Mondovì 6	                      456264-O','Uscita prima dell\'alba per effettuare un appostamento in località Ciola Corniale, come da indicazioni ricevute accertato ancora in orario notturno due registratori in funzione riproducenti il verso di merlo e tordo bottaccio provenire da un\'abitazione. prima dell\'alba individuato un soggetto aggirarsi nel cortile e spegnere i mezzi vietati per poi portarsi nelle vicine aree incolte per esercitare l\'attività venatoria. Non potendo intervenire a causa della presenza di un calanco interposto fra noi e il cacciatore e dopo aver chiaramente individuato il personaggio già noto agli agenti, si decideva di rimandare l\'operazione in un momento più favorevole per non trovare poi problemi di contestazione o vedersi fuggire il trasgressore. Sanzionato più tardi  un cacciatore che esercitava attività venatoria a ridosso di una strada.\nSeconda parte della giornata riservata ai controlli in zona aeroporto, durante il controllo di un appostamento accertavamo l\'uso di richiami di storno in penna, elevati due verbali di accertamento amministrativo per la violazione della delibera regionale che regola la caccia in deroga. \nDa segnalare che durante il controllo il più giovane dei due occupanti opponevano pretestuosamente e provocatoriamente resistenza ai controllo, intralciando l\'operato degli agenti intenti a raccogliere la documentaziuone fotografica della violazione e rivendicando il proprio ruolo di rappresentante di una importante cooperativa locale. Dopo aver pronunciato frasi denigratorie aventi chiaramente i sottoscritti come destinatari, se pur non citati direttamente, concludeva che si sarebbe attivato tramite tutti i canali di sua conoscenza per giungere all\'obiettivo di fare togliere il decreto ai sottoscritti.','Multipla associazione Maricla CZ 816 BP',0,NULL,NULL,NULL),(1971,2688,4,'2016-10-23 04:00:00','2016-10-23 11:00:00','Cognome	             Nome	                 nato a:	                 il	                      Residente	                          indirizzo	                           Porto D\'Armi\nRosa	          Adriano	                Riccione	           18/09/56	          Misano Adriatico	             Via Fontanone 9/C	              652158-N\nPiccioni	          Antonio	                Riccione	           10/06/56	               Riccione	                          Via Licata 6	                      694949-M','Nuovo appostamento in località Ciola Corniale, al fine di sorprendere il cacciatore individuato il giorno precedente commettere illeciti ma con esito negativo. Spostati i controlli lungo il fiume Marano in località Riccione. \nIn località San Lorenzo sono state registrate alcune lamentele da parte degli abitanti che esaperati dalle esplosioni mattutine non consentono loro di poter riposare tranquillamente. Accertato che per la configurazione morfologica di gran parte del torrente, anche lungo via Lombardia, le esplosioni presentano un effetto sonoro molto più rilevante che in altre zone. Urge in effetti trovare una soluzione al fenomeno che è risultato molto fastidioso al limite della tolleranza anche ai sottoscritti agenti.','Multipla ass. Maricla CZ 816 BP',0,NULL,NULL,NULL),(1972,2571,11,'2016-09-01 05:30:00','2016-09-01 10:30:00','CACCIATORI CONTROLLATI\nPICCIONI  ANTONIO lic. n. 644949-N  \nSARTINI FEDERICO lic.  n. 952341-M \nSARTINI ROBERTO  lic. n. 694592-M\nRAGNI DOMENICO  lic. n. 456648-D\nFAVARELLI GRAZIANO lic. n. 675142-M\nGIORGI ANGELO lic. n. 676035-M\nGAFFARELLI CESARE lic. n. 952030-M\nGAFFARELLI MAURIZIO lic. n. 694597-M\nMANZAROLI ANDREA lic. n. 95143