:00','Cognome	        Nome	             nato a:	                     il	                         Residente	                        indirizzo	                            Porto D\'Armi\nGessaroli         	Gianluca	             Rimini	                           24/02/69	            Rimini	                              Via Barrili 7	                     694913-M\nCoccia	                Massimiliano	     Rimini	                           11/**/1969	            Rimini	                              Via Padulli 79 o 75	              *********\nBazzocchi	        Piero	            Cesena (FC)	           08/01/44	            Rimini	                              Via B. Ricasoli 15	             676052-N\nConti	                Gilberto	            Novafeltria (PU)	           02/10/65	            Santarcangelo di R.	      Via San Vito 549	             456618-NO','Controlli nei comuni di Rimini, Poggio Torriana, Santarcangelo, Bellaria. Attenzione rivolta principalmente nella zona del fiume Marecchia, unico luogo dove si registrava la presenza di qualche cacciatore, non contestata alcuna sanzione amministrativa in quanto non si è riusciti a individuare per tempo l\'autore di alcune infrazioni rilevate comunque da lunga distanza con l\'ausilio dei binocoli in dotazione. I trasgressori sono comunque inclusi fra i nominativi dell\'elenco sotto riportato.\nDurante la fine della mattinata effettuato sopralluoghi nei chiari da caccia propedeutici ai controlli che verranno messi in atto nei prossimi giorni.','Multipla associazione Maricla CZ 816 BP',0,NULL,NULL,NULL),(2136,2826,4,'2016-12-10 03:30:00','2016-12-10 10:30:00','Cognome	             Nome	                    nato a:                       	il	                  Residente	                            indirizzo	                         Porto D\'Armi\nGorrieri	                    Giancarlo	           San Leo PU	              08/02/53	           Poggio Torriana	                  Via Dante Alighieri 7	          694491-M\nMoroni	                    Bruno	                  Poggio Berni	              09/02/46	           Rimini	                                  Via Stelvio 42	                          694464-M\nBianchi	                    Arnaldo	          Rimini	                      04/03/53	           Rimini	                                  Viale Vittorio Veneto 42	          676659-N\nNucci	                   Giancarlo	         Gatteo FC	              29/11/43	          Gambettola FC	                  Via Consolata 17	                  648484-N\nSacchini	                   Marco	                 Gambettola FC	      20/09/56	          Gambettola FC	                  Via Sozzi 5	                          647395-N','Servizio notturno/mattutino finalizzato al controllo della caccia fuori orario effettuata dai titolari di appostamento fisso in area umida nel comune di Poggio Torriana in zona demaniale. Oltre agli agenti summenzionati ha partecipato come volontario e aspirante guardia Claudio Papini del WWF di Rimini, il quale ha svolto anche un ruolo di supporto tecnico per una operazione di verifica.\nUditi colpi d\'arma da caccia già alle ore 5:53, poi successivamente alle 6:05 e alle 6:23, ben fuori orario rispetto all\'ora prevista dal Calendario Venatorio Regionale che indica come ora per l\'inizio della caccia alla migratoria alle 6:40. Individuati presso un appostamento gli autori e contestato la violazione commessa. Nel secondo appostamento, non essendo stato possibile contestare il fuori orario per questioni pratiche, venivano comunque rilevate altre due violazioni amministrativa quali la mancata annotazione del capo appena abbattuto e l\'uso del munizionamento a piombo. Riscontrato un problema di limitazione di accesso al capanno di caccia, volutamente chiuso con catena e luchetto e un uso di trappole per nutria puntualmente segnalati al comandante della Polizia Provinciale.','Associazione Maricla Multipla CZ 816 BP',0,NULL,NULL,NULL),(2137,2833,4,'2016-12-11 03:30:00','2016-12-11 10:30:00','Cognome   	              Nome	                      nato a:	                                 il	                        Residente	                       indirizzo	                                 Porto D\'Armi\nMorigi	                     *********	              *********	                                *********	                *********	                               *********	                                  *********\nBattarra	                     *********	              *********	                                *********	                *********	                               *********	                                  *********\nFornari	                   Giancarlo	           Santarcangelo di R.	                01/03/42	                Poggio Berni	                      Via Andrea Costa 15 	          675955-N\nMarconi	                   Alex	                   Cesena (FC)	                               16/08/89	                Gatteo FC	                      Via Papa Giovanni XXXIII 4	  141918-O\nMarconi	                   Antonello	           Savignano sul Rubicone FC 	17/01/57	                Gatteo FC	                      Via Papa Giovanni XXXIII 4	  141917-O\nCarlini	                  Massimiliano	           Rimini	                                        29/01/68	                Coriano	                              Via Monte 39	                          456700-O\nVignali	                  Giampiero	           Rimini	                                        14/12/62	                Rimini	                              Via Marecchiese  610	           676747-N\nZammarchi	          Luigi	                  Santarcangelo di R.	                14/02/42	                Verucchio	                              Via Del Vecchio Ghetto 30	   456526-O\nUrbinati	                 Giovanni	                  Verucchio	                                05/11/46	                Verucchio	                              Via Lamarmora 22	                   247087-O','Servizio notturno/mattutino finalizzato al controllo della caccia fuori orario effettuata dai titolari di appostamento fisso in area umida nel comune di Poggio Torriana in zona demaniale, zona Vulcangas. Oltre agli agenti summenzionati ha partecipato come volontario e aspirante guardia Claudio Papini del WWF di Rimini, il quale ha svolto anche un ruolo di supporto tecnico per una operazione di verifica.\nRiscontrato l\'inconsueta presenza di cacciatori in orario non previsto per lo svolgimento dell\'attività venatoria, vicino le proprie auto a temperature rigide, nei pressi dei loro appostamenti di caccia, in attesa, a loro dire, dell\'orario consentito per recarsi all\'appostamento per poter svolgere l\'attività venatoria. Durante i controlli uditi colpi di fucile da caccia provenire dagli appostamenti controllati il giorno precedente, dove erano state elevate contestazioni di illecito amministrativo. Non si è potuto intervenire per questioni logistiche.\nControllati tutti gli appostamenti fissi autorizzati in loco e contestata la violazione di un illecito amministrativo per mancata annotazione di un capo di fauna selvatica abbattuto e già recuperato.\nEmerso il forte sospetto che i cacciatori fossero a conoscenza dell\'intervento efettuato dagli agenti il giorno precedente più a valle e che si aspettassero il nostro controllo.\nRilevato alcuni particolari che hanno fatto intuire agli agenti che l\'attività di caccia fuori orario sia una pratica abbastanza consueta in zona.','Multipla Associazione Maricla CZ 816 BP',0,NULL,NULL,NULL),(2138,2837,4,'2016-12-18 03:30:00','2016-12-18 09:00:00','Cognome	                        Nome	                     nato a:	                         il	                      Residente	                       indirizzo	                                        Porto D\'Armi\nSacchini	                       Marco	                   Gambettola FC	              20/09/56	             Gambettola FC	             Via Sozzi 5	                               