eniva identificato al fine di procedere ad ulteriori accertamenti in merito alla possibilità di pescare in acque interne in Italia anche senza il prescritto versamento regionale. A seguito dei risultati degli accertamenti, se verrà ris','FIAT PANDA taragata ET966BV intestata alla Guardia Ittica Edoardo Morri.',0,NULL,NULL,NULL),(2818,3604,10,'2017-09-17 07:00:00','2017-09-17 12:00:00',' ','localita ponte messa , marecchia laghi della cina, incal sistem',' ',0,NULL,NULL,NULL),(2819,3606,10,'2017-09-19 08:00:00','2017-09-19 11:00:00',' ','uso bellaria santarcangelo .marecchia ponte di legno',' ',0,NULL,NULL,NULL),(2820,3671,5,'2017-10-01 04:30:00','2017-10-01 12:00:00',' su segnalazione telefonica pervenutami  mi sono portato in localita Spadarolo di rn, presso campo da baseball federale in v. dei mulini , lamentavano la presenza di un\' altana x caccia di selezione, dove prendevano posto 2 persone con carabina . ho preso misura con telemetro che dava m. 113 dalla recinzione . fatte foto, inviate via telematica a polizia provinciale per verifiche , avvisati telefonicamente.','vigilanza venatoria n ei comuni di Coriano - Montescudo- Rimini --- controllo effettuato a 20 cacciatori - risultati tutti in regola','  panda gev --percorsi km 54',0,NULL,NULL,NULL),(2821,3665,4,'2017-09-24 05:00:00','2017-09-24 11:00:00','Cognome	          Nome	              nato a:	               il	                 Residente	                              indirizzo	                           Porto D\'Armi\nSucci	                  Marco	             Rimini	                    02/01/79	           Rimini	                                      Viale L. Cenci 15	              246638-O\nBettini	                  Ivano	             Novafeltria (PU)	    19/03/55	          Savignano sul Rubicone (FC       Via G. Vendemini 9	              142259-O\nMassarenti	         Gabriele	             Rimini	                    19/05/54	          Rimini	                                      Via C. Bagli 51	         