017-10-15 05:00:00','2017-10-15 12:00:00','Cognome	Nome	       nato a:	                                  il	                 Residente	                            indirizzo	                               Porto D\'Armi\nMontali	       Andrea	       Santarcangelo di R.	               14/07/75	         Santarcangelo di R.	            Via Santarcangiolese 3235	        951973-N\nSacchetti	       Nevio	               Savignano sul Rubicone FC	22/10/68	         Savignano sul Rubicone (FC)	    Via Pietro Micca 15	                143237-O\nConti	       Alessandro      Santarcangelo di R.	                28/11/70	         Santarcangelo di R.	            Via Amendola G. 5	                676750-N','Controlli in zona San Michele nel comune di Santarcangelo. \nFin dalla prima mattinata appostamento finalizzato a monitorare alcuni siti di caccia già individuati il giorno precedente, in particolare l\'attenzione è stata rivolta ad un appostamento di caccia molto attivo sotto il profilo degli abbattimnti di selvatici. Dopo aver osservato attentamente con l\'ausilio dei binocoli il comportamento dei due cacciatori presenti all\'interno, procedavamo ai controlli contestando agli occupanti la mancata segnatura dei capi abbattuti in diverse azioni di caccia, e parti di questi recuperati e poi lasciate all\'esterno del loro appostamento. Allontanandoci informavamo i diretti interessati che la nostra attività continuava in loco e che la segnatura andava fatta a capo raccolto (anche se la normativa non dice questo ma a capo abbattuto). dopo circa un paio d\'ore, dopo altri nostri controlli in zona notavamo  con i binocoli che forse gli occupanti dello stesso appostamento non si attenevano alle disposizioni appena impartite, procedavamo quindi ad una seconda verifica e rinvenivamo alcuni capi di storno abbattuti all\'interno del loro sito di caccia, anche questi non segnati. I medesimi si giustificavano sostenendo di aver contattato telefonicamente i loro referenti venatori e aver ricevuto