mini	     04/08/45	            Rimini	                    Via Dario Campana 70               951434-N','Al fine di alleggerire i controlli sulle aree da noi affidate, si è proceduto nella giornata di oggi a spostarci nella zona più centrale della provincia. Scarso il passo di migratori e la presenza di cacciatori.\nDa segnalare un appostamento fisso senza richiami vivi autorizzato dalla regione, situato nei coltivi a monte di via Maceri 27 a Santa Maria in Cerreto, che al controllo non risulta presentare delle criticità con la distanza dalla recinzione di un immobile e da un posto di lavoro e ricovero attrezzi. Inviato materiale telematico alla Polizia Provinciale affinchè possa porre in essere, qualora lo ritenga, i necessari accorgimenti per verificare quanto da noi rilevato.','Multipla Maricla CZ 816 BP',0,NULL,NULL,NULL),(2910,3763,5,'2017-11-08 06:00:00','2017-11-08 12:00:00',' vigilanza venatoria , non rtiscontrato irregolarità','vigilanza venatoria zona sud coriano - Montescudo - gemmano - montefiorecontrollati 1 cacciatore  _ assistito ad inizio girata al cinghiale in località Serbadone--',' panda gev  percorsi km. 90',0,NULL,NULL,NULL),(2911,3764,5,'2017-11-08 05:30:00','2017-11-08 12:00:00',' vigilanza venatoria nei comuni sopracitati - controllati 2 cacciatori','vigilanza venatoria nei comuni di Coriano - Montescudo Montecolombo controllati 2 cacciatori . visto inizio tabellatura   per girata al cinghiale in zona valecchio  - sq. cinghiali di Montescudo -.--',' panda gev . km percorsi 77',0,NULL,NULL,NULL),(2912,3778,4,'2017-11-04 05:00:00','2017-11-04 11:00:00','Cognome	Nome	    nato a:	                       il	             Residente	                       indirizzo	                                          Porto D\'Armi\nDominici	      Giorgio	   Sassocorvaro PU	        15/10/59	      Santarcangelo di R.	       Via Trasversale Marecchia 3498	  675115-N\nValenti	      Riccardo	   Rimini	                         22/03/73	      Santarcangelo di R.	       