a presenza di bracconieri che con le reti hanno cercato di ripulire completamente il lago, quasi riuscendoci.\nLa zona è in area SIC, inoltre tale lago ci risulta essere l’unico nella provincia dove si trova una popolazione di Tinche autoctone, quindi il fatto accaduto è ancora più grave di quello che le abbiamo segnalato al ponte di legno.\nAltri controlli hanno rilevato come si continui a cacciare lo storno dove ormai non esistono quasi più le condizioni sufficienti per poterlo fare.','Multipla Maricla CZ 816 BP',0,NULL,NULL,NULL),(2915,3784,4,'2017-11-12 05:00:00','2017-11-12 10:30:00','Cognome	        Nome	     nato a:	            il	              Residente	                       indirizzo	                                      Porto D\'Armi\nBiselli	       Stefano	    Rimini	                 20/04/73	         Rimini	                     Via Marecchiese 480/A	              660663-O\nBiselli	       Bruno	   Montefiore	         23/07/43	         Rimini	                     Via Marecchiese 480	                      952193-N\nMartino	       Antonio	   Teggiano (SA)	12/07/56	       Sant\'Arcangelo di R.	     Via Savina 2338	                              456853-O\nBazzocchi	       Piero	          Cesena (FC)	        08/01/44	         Rimini	                     Via B. Ricasoli 15	                      676052-N\nFraternali	      Marco	          Rimini	                29/09/81	         Rimini	                    Via Montemaggio 27	                       676808-N','Controlli lungo via Santa Cristina e in zona Mavone, dove alcuni cittadini giorni prima lamentavano la presenza di cacciatori fra le abitazione sui social network.\nProprio in questa zona veniva sorpreso un cacciatore in attività venatoria vagante con arma carica su una strada comunale. Si provvedeva ad elevare una contestazione di illecito amministrativo.\nDuranti i controlli del padre, anch\'egli a caccia poco distante, emergeva una inadempienza amministrativa che ci riservavamo di approfondire con gli uffici