e 57	456662-O','Controlli dell\'attività venatoria sempre nella porzione centrale della provincie e precisamente nelle seguenti località, Rimini, Ospedaletto, S. Martino Montellabate, S. L. Corregiano, Covignano. Riscontrato in due distinte occasioni due violazioni  carattere amministrativo, per le quali è stata elevatala contestazione di illecito e notificata a mano agli interessati. La seconda violazione contestata ha riguardato lo sparo in direzione di una strada che ha creato una situazione di grave pericolo per eventuasli assanti ma anche per gli stessi agenti che stavano avvicinanosi per i controlli.','Automezzo privato Multipla targa CZ 816 BP',230,NULL,'2018-10-15 17:09:15','2018-10-15 17:17:50'),(3717,4721,4,'2018-10-13 06:00:00','2018-10-13 11:00:00','Cacciatori Controllati:\r\nSolferino	Mino	Rimini	10/03/58	Rimini	Via Cotignola 6	660728-O\r\nPagliarani	Vittorio	Rimini	18/12/36	Rimini	Via Vecchia Emilia 11	660734-O\r\nGiorgini	Antonello	Savignano sul Rubicone FC	27/12/65	Santarcangelo di R.	Via Belvedere 11	456830-O\r\nSalvatori	Fabrizio	Santarcangelo di R.	31/10/67	Rimini	Via','Servizio a ranghi ridotti per sopraggiunti impegni agli altri agenti del nucleo. Effettuato una serie di verifiche e di controlli mirati a situazioni già note agli scriventi. E\' stato inoltre possibile udire  il suono di alcuni registratori per la fauna selvatica in funzione provenire dalla zona oltreconfine con la provincia di FC, situazione che occasionalmente si ripropone e che necessita di un intervento risolutivo.\r\nNon riscontrato invece situazioni irregolari nella nostra provincia.\r\nLe località perlustrate sono state Bellaria, Igea Marina, Viserba, Rimini, Santarcangelo, San Vito.','Attività svolta con automezzo Multipla Targa CZ 816 BP',100,NULL,'2018-10-15 17:19:04','2018-10-15 17:29:59'),(3718,4727,4,'2018-10-14 06:00:00','2018-10-14 13:00:00','Cacciatori Controllati:\r\nProtti	Sergio	San Clemente	07/11/44	Riccione	Via Oneglia 29	676226-N\r\nDel Bianco	Antonio	Riccion