ULL,'2019-09-19 12:44:50','2019-09-19 12:44:50'),(4402,5478,11,'2019-08-29 06:00:00','2019-08-29 12:00:00','inserimento d\'ufficio',NULL,NULL,85,NULL,'2019-09-19 13:00:27','2019-09-19 13:00:27'),(4403,5445,4,'2019-09-01 05:00:00','2019-09-01 12:30:00','Cacciatori controllati:\r\nLeardini	Gianfranco	Morciano di Romagna	28/06/67	Riccione	Via Maroncelli 4	247257-O\r\nGiovanetti	Graziano	Rimini	19/10/59	Saludecio	Via San Rocco 615 int.3	246082-O\r\nGarelli	Patrizio	Santarcangelo di R.	20/03/58	Santarcangelo di R.	Via Roveto 415	819903-O','Servizio svolto da pattuglia composta da agnti venatori e agenti zoofili del WWF. Nella primissima mattinata sorvegliate alcune aree del comune di Coriano dove ci era stato segnalato la possibilità che si cacciassero specie non consentite in preapertura, poi a seguire la pattuglia si è mossa sempre più a nord controllando i comuni di Rimini, Verucchio, Santarcangelo di R. e Bellaria Igea Marina. In quest\'ultimo comune è statata riscontrata una situazione illecita per la quale  non si è potuto intervenire essendo l\'appostamento temporaneo non regolare (distanza da via Donegallia meno di 150 mt) risultava collocato nell\'ansa del fiume Uso della Provincia di FC dove gli agenti non hanno più decreto venatorio. In tale occasione è stato chiamato il comandante della Polizia Provinciale per consulto ed i CCF per richiedere un intervento, ma essendo impegnati non sono potuti venire in supporto. Nella giornata elevata una contestazione di illecito amministrativo.','Multipla CZ816BP, associazione Maricla',140,NULL,'2019-09-21 06:30:54','2019-09-21 06:30:54'),(4404,5462,4,'2019-09-08 05:15:00','2019-09-08 12:00:00','Cacciatori controllati:\r\nFosci	Giuseppe	Urbio (PS)	27/12/56	Riccione	Via Derna 26	660752-O\r\nFrisoni	Enzo	Riccione	30/11/43	Santarcangelo di R.	Via Pozzo 220	951957-N\r\nPirini Casadei	Mario	Cesena (FC)	11/01/59	Savignano sul Rubicone (FC)	Viale Della Libertà 50	143246-O','Servizio svolto da pattuglia composta da agenti venatori e agenti zoofili del WWF. \r\nControlli effettuati nei comuni di Rimini, Santarcangelo, Verucchio, Poggio Torriana e Bellaria Igea Marina. Durante il servizio rinvenuto su un albero situato nei coltivi di via Savina un Airone Guardabuoi con un ala spezzata, recuperato e consegnato al CRAS di Corpolò. Nella vegetazione lato strada di via Corpolò Fossatone è stato rinvenuto un esemplare di capriolo morto in avanzatissimo stato di putrefazione, tale da non consentire nessun rilievo o richiesta di intervento di nessun servizio. Nel comune di Bellaria  Igea Marina riscontrato una serie di appostamenti temporanei appena smobilitati, nella richiesta di spiegazioni agli occupanti questi affermavano di essersi posti in quella situazione perchè un guardiacaccia avrebbe detto loro che essa poteva essere tollerata se tutti d\'accordo. il cacciatore Salvatori Leo, ben conosciuto dagli agenti, ha anche fatto nome e cognome del guardiacaccia che avrebbe suggerito la maniera distorta dell\'interpretazione legislativa. Gli agenti hanno poi provveduto a chiarire ai cacciatori quale fossero le norme corrette e diffidati dal comportarsi in tale maniera in avvenire perchè il comportamento è sanzionabile.','Multipla associazione Maricla CZ 816 BP',120,NULL,'2019-09-21 06:52:10','2019-09-21 06:52:10'),(4405,5471,4,'2019-09-15 05:30:00','2019-09-15 11:30:00','cacciatori controllati:\r\nCappa	Giorgio	Roncofreddo (FC)	29/12/52	Santarcangelo di R.	Via Roveto 803	252190-P\r\nZanni	Lino	Santarcangelo di R.	14/06/40	Santarcangelo di R.	Via Dell\'Industria 8	660903-O\r\nBugli	Daniele	Santarcangelo di R.	24/04/61	Santarcangelo di R.	Via Santarcangiolese 2515	247423-O\r\nSpinelli	Paolo	Santarcangelo di R.	14/07/60	Santarcangelo di R.	Viale Mazzini 50	770277-O\r\nBaldini	Mattia	Cesena (FC)	02/06/92	Santarcangelo di R.	Via Roveto 1120	456699-O\r\nConti	Alessandro	Santarcangelo di R.	28/11/70	Santarcangelo di R.	Via Amendola G. 5	252527-P\r\nTufariello	Luigi	Cerignola (FG)	19/01/71	Rimini	Via Lucio Lando 45	246609-O\r\nDeluca	Vittorio	Santarcangelo di R.	12/02/37	Rimini	Via U. di Miniello 43	660712-O\r\nFerrini	Paolo	Rimini	11/03/54	Rimini	Via Maiano 9	251924-P\r\nFerrini	Claudio	Rimini	11/03/51	Rimini	Via Maiano 7/A	819326-O\r\nBernabini	Aldo	Roncofreddo (FC)	18/04/55	Rimini	Via C. Bagli 60	951897-N\r\nBernabini	Edgardo	Roncofreddo (FC)	16/01/42	Rimini	Via C. Bagli 55	251834-P','Servizio congiunto guardie venatorie e zoofile WWF. Pattuglia a ranghi ridotti per la prima giornata di caccia generale. controllato comuni di Rimini, Santarcangelo, Bellaria Igea Marina. Nutrita presenza di cacciatori e primo controllo al presidente FIDC di santarcangelo il quale si poneva subito in pessima maniera nei confronti degli agenti non volendo mostrare la documentazione di caccia in maniera idona, situazione poi stemperata dopo averlo informato delle conseguenze in cui esso andava incontro se manteneva tale atteggiamanto.\r\nOsservato diversi comportamenti al limite della legalità, per i quali gli agenti hanno poi chiarito con chi cacciava come comportarsi per non incorrere in sanzioni, niente comunque che dovesse essere sanzionato al momento, anche se ci si riserva di approfondire meglio i controlli in altri momenti della stagione venatoria.','Multipla associazione Maricla CZ 816 BP',100,NULL,'2019-09-21 07:08:17','2019-09-21 07:08:17'),(4406,5382,8,'2019-09-08 07:00:00','2019-09-08 13:00:00','nominativi nel cartaceo','svolto turno di vigilanza nelle prime colline riminesi.','Borghini Pier Paolo',82,NULL,'2019-09-21 16:43:20','2019-09-21 16:43:20'),(4407,5385,8,'2019-09-18 14:00:00','2019-09-18 19:00:00',NULL,'svolto servizio nella zona di Faetano e confini con San Marino.\r\nNulla da segnalare','Tonini Pierluigi',64,NULL,'2019-09-21 16:48:06','2019-09-21 16:48:06'),(4408,5384,8,'2019-09-11 14:00:00','2019-09-11 19:00:00','Recuperato Rapace ferito e portato al centro A.N.P.A.N.A.','svolto turno nella zona di Rimini \"Concimaia\" e Corpolò.','Giovanardi Mauro',76,NULL,'2019-