o di binocoli, principalmente mirati a verificare il rispetto della distanza da immobili e strade da parte dei cacciatori. non riscontrate palesi irregolarità. Comuni interessati dai controlli: Rimini, bellaria igea Marina, Santarcangelo.','CZ 816 BP Associazione Maricla',100,NULL,'2019-10-10 07:25:24','2019-10-10 07:25:24'),(4464,5500,4,'2019-09-29 05:30:00','2019-09-29 11:30:00','Cacciatori Controllati: Nucci	Antonio	Sogliano al Rubicone (FC)	20/09/39	Rimini	Via Aldo Moro 75	456428-O\r\nPavesi	Giacomo	Rimini	12/06/99	Rimini	Via Mirabello 5	819526-O\r\nVignali	Alex	Borgo Maggiore (RSM)	26/11/96	Acquaviva (RSM)	Via E. Notaio 17	05413-B\r\nCappelli	Alessandro	Rimini	08/07/79	Pennabilli	Via Del Raggio 2	952071-N\r\nCappelli	Evaristo	Sant\'Agata Feltria	14/04/43	Novafeltria	Via Marecchia 119	252738-P','Controlli caccia con squadra al completo a partire dai comuni di Rimini, Coriano, Santarcangelo, Verucchio, Bellaria-Igea Marina.\r\nNon riscontrato particolari situazioni di criticità e non rilevato infrazioni.','Multipla associazione Maricla CZ 816 BP',140,NULL,'2019-10-10 07:38:59','2019-10-10 07:38:59'),(4465,5520,4,'2019-10-06 06:00:00','2019-10-06 12:00:00','Cacciatori Controllati: Pazzaglia	Paolo	Cesena (FC)	04/02/71	Santarcangelo di R.	Via Fornello 127	252722-P\r\nPazzaglia	Romano	Longiano (FC)	06/03/48	Santarcangelo di R.	Via Fornello 70	542075-O\r\nSantini	Giovanni	Borghi FC	16/07/56	Savignano sul Rubicone (FC)	Via Eistein 20	143234-O\r\nBrigliadori	Ednarder	Borghi FC	25/05/54	Borghi (FC)	Via G. Brandolini 121	143571-N','Effettuato controlli lungo tutto il confine con la provincia di FC, partendo da Bellaria Igea Marina fino a Poggio Toriana, soffermandoci su aree più critiche come San Vito, Canonica, Montalbano, Felloniche, Ciola Corniale . Riscontrato diverse situazioni non regolari, ma non contestabili in quanto la segnaletica relativa ai confini degli ATC non risulta essere adeguatamente posizionata, infatti interi tratti di confine risultano sprovvisti della tabellazione e in alcuni casi completamente occultata dalla vegetazione. Nella fase di ritorno effettuato controlli lungo l\'asta fluviale del Fiume Marecchia e controlli circa le nuove ordinanze relative alle piste ciclabili o percorsi storico naturalistici.','Multipla associazione Maricla CZ 816 BP',130,NULL,'2019-10-10 07:51:53','2019-10-10 07:51:53'),(4466,5526,5,'2019-10-12 07:00:00','2019-10-12 13:00:00','vigilanza in convenzione','vi gilanza venatoria nei Comuni di COriano - riccione - gemmano - S. Clemente . rn. controllati 2 cscciatori -- nulla da segnalare .','auto gev. eh 272 fl',134,NULL,'2019-10-14 09:07:41','2019-10-14 09:07:41'),(4467,5529,4,'2019-10-13 06:30:00','2019-10-13 11:30:00','Cacciatori Controllati:\r\nMontali	Andrea	Rimini	14/07/75	Santarcangelo di R.	Via Santarcangiolese 3235	951973-N\r\nZammarchi	Giorgio	Santarcangelo di R.	09/02/45	Santarcangelo di R.	Via Misano 2	660546-O\r\nBaschetti	Giovanni	Santarcangelo di R.	25/05/41	Santarcangelo di R.	Via Santarcangiolese 2743	819956-O\r\nUrbinati	Armando	Verucchio	06/05/48	Verucchio	Via Dei Martiti 54	252818-P\r\nCarattoni	Aurelio	Rimini	16/02/45	Domagnano (RSM)	Str. Gentoni 28	02440B\r\nAngelini	Mario	San Leo (PU)	02/10/49	Verucchio	Via Vicinale Poggio Molino 190	819337-O','In prima mattina effettuato vigilanza sull\'attività venatoria a ridosso dei confini con la provincia di FC, e precisamente nei comuni di Bellaria Igea Marina, Santarcangelo e Poggio-Torriana dove in quest\'ultimo controllavamo tale Montali Andrea a caccia in un appostamento temporaneo. Scesi ancora verso il comune di Santarcangelo notavamo due cacciatori svolgere l\'attività venatoria presso l\'appostamento fisso di tale Montali Andrea, controllato poco prima a caccia in altro comune. Ad una verifica risultava che l\'appostamento fisso non era  più posizionato nel punto autorizzato ed i due cacciatori che stavano svolgendo attività di caccia nell\'area (Zammarchi e Baschetti), ci riferivano che lo spostamento era stato effettuato dallo stesso titolare per consentire ai mezzi agricoli di poter lavorare il terreno su cui il capanno da caccia era posizionato, ci riserviamo quindi di approfondire la questione nelle prossime uscite, quando il titolare sarà presente. Successivamente ci portavamo nei  comuni di Verucchio e di Rimini, a Corpolò potevamo osservare come tre cacciatori in battuta in forma vagante si portavano prima a ridosso e poi attraversavano via Corpolò Fossatone con le loro armi da caccia cariche, nei confronti dei tre veniva elevato verbale di accertamento di violazione amministrativa.','Multipla  CZ 816 BP Associazione Maricla',145,NULL,'2019-10-19 10:37:51','2019-10-19 10:37:51'),(4468,5535,4,'2019-10-19 06:30:00','2019-10-19 11:00:00','Cacciatori controllati:\r\nGiovannini	Paolo	Cesena (FC)	03/04/72	Bellaria-I.Marina	Via Vivaldi 1	252878-P\r\nCasali	Franco	Rimini	24/10/45	Bellaria-I.Marina	Via Ravenna 228	246078-O\r\nCasali	Antonio	Rimini	16/01/52	Bellaria-I.Marina	Via Monteverdi 24	819963-O\r\nFabbri	Silvio	Torriana	12/01/59	Bellaria-I.Marina	Via S. Apollonia 19	456857-O','In prima mattinata sono stati effettuati controlli presso l\'appostamento temporaneo dei fratelli Casali a Bellaria, dopo circa un\'ora di osservazione con l\'ausilio dei binocoli su ciò che avveniva, ci portavamo a contestare lo svolgimento dell\'attività venatoria in tre persone all\'interno dello stesso appostamento temporaneo. Durante la contestazione dell\'illecito amministrativo il sig. Casali Franco reagiva malamente riprendendo in mano l\'arma precedentemente scaricata e minacciando di ricaricarla per farne un uso improprio, a quel punto l\'intervento tempestivo del fratello Antonio  e dell\'agente Bruschi sedavano subito la reazione del soggetto, lo stesso agente Bruschi informava il Casali Franco che da quel momento qualsiasi altra frase o gesto di dubbia interpretazione avrebbe fatto scattare una denuncia presso agli organi competenti. In tale frangente il sig. Casali Antonio diceva, rivolgendosi agli agenti, di salutare per lui tale \"Bonanni\", alla richiesta di specificare meglio chi fosse tale persona egli faceva intendere che fosse un conoscente della Questura (palese anche l\'intento della frase in un contesto non richiesto).  Successivamente venivano stesi i verbali di contestazione amministrativa, con il terzo cacciatore occupante dell\'appostamento  che ripredeva le fasi della stesura con un telefono cellulare Iphone. Il medesimo veniva comunque informato dall\'agente Bruschi che tale atteggiamento non era espressamente vietato, ma che la divulgazione in modo qualsivoglia impropria delle immagini poteva essere oggetto di denuncia da parte degli agenti stessi. Durante il controllo del sito di caccia venivano individuati elementi che meriteranno di essere ulteriormente approfonditi in successivi controlli da programmare. Altri controlli in zona venivano effettuati successivamente.','Multipla associazione Maricla CZ 816 BP',55,NULL,'2019-10-19 11:10:56','2019-10-19 11:10:56'),(4469,5532,11,'2019-10-19 14:00:00','2019-10-19 19:00:00','INSERIMENTO D\'UFFICIO',NULL,NULL,85,NULL,'2019-10-21 09:58:23','2019-10-21 09:58:23'),(4470,5533,11,'2019-10-20 07:00:00','2019-10-20 12:00:00','INSERIMENTO D\'UFFICIO',NULL,NULL,90,NULL,'2019-10-21 09:59:08','2019-10-21 09:59:08'),(4471,5381,2,'2019-09-22 15:00:00','2019-09-22 18:30:00','INSERIMENTO D\'UFFICIO',NULL,NULL,97,NULL,'2019-10-21 10:00:58','2019-10-21 10:00:58'),(4472,5378,2,'2019-09-08 06:00:00','2019-09-08 11:40:00','INSERIMENTO D\'UFFICIO',NULL,NULL,121,NULL,'2019-10-21 10:01:57','2019-10-21 10:01:57'),(4473,5540,2,'2019-09-05 14:00:00','2019-09-05 18:30:00','INSERIMENTO D\'UFFICIO',NULL,NULL,66,NULL,'2019-10-21 10:29:35','2019-10-21 10:29:35'),(4474,5541,2,'2019-09-12 14:00:00','2019-09-12 18:00:00','INSERIMENTO D\'UFFICIO',NULL,NULL,70,NULL,'2019-10-21 10:30:24','2019-10-21 10:30:24'),(4475,5542,2,'2019-10-19 14:30:00','2019-10-19 18:30:00','INSERIMENTO D\'UFFICIO',NULL,NULL,72,NULL,'2019-10-21