','Cacciatori controllati:\r\nMorri	Sirio	Rimini	15/10/45	Riccione	Via Udine 5/A	252535-P\r\nMorri	Massimo	Rimini	12/02/74	Riccione	Via Udine 5/A	246132-O\r\nCapacci	Adriano	Rimini	11/09/65	Rimini	Via Rontanini 7/A	246175-O\r\nRossi	Davide	Rimini	01/06/68	Rimini	Via Vcorciano 34	456649-O','Giornata interessata dal cambio dell\'orario e quindi anticipata l\'uscita di vigilanza.\r\nControlli concentrati nella zona che circonda l\'aeroporto di Rimini, dove nei giorni precedenti erano stati uditi diversi colpi d\'arma da  caccia, effettuato verifiche presso un appostamento dove si è provveduto ad elevare un verbale di contestazione di illecito amministrativo nei confronti di uno degli occupanti. \r\nAltri comportamenti al limite della regolarità e la presenza di un minore nell\'appostamento ha indotto gli agenti a  suggerire egli occupanti di usare maggiore cautela nell\'uso e nella custodia delle armi.\r\nSuccessivamente, gli occupanti di un altro appostamento sono stati invitati a regolarizzare la posizione in merito alla modalità di conteggio delle distanze da strade e immobili, passibili di future contestazioni negli eventuali successivi controlli I medesimi affermavano di essere stati indotti da altri organi di controllo a posizionarsi con tale modalità, ritenendo alcuni immobili posti nelle pertinenze del loro sito di caccia non rilevanti, ma pronti a regolarizzarsi da subito.','Multipla associazione Maricla CZ 816 BP',95,NULL,'2019-11-02 16:36:19','2019-11-02 16:36:19'),(4497,5555,4,'2019-11-02 06:00:00','2019-11-02 11:00:00','Cacciatori controllati:\r\nDuca	Andrea	Rimini	30/06/84	Rimini	Via Cantiano 12	819191-O\r\nMondaini	Emanuel	Rimini	22/02/84	Serravalle (RSM)	Via A. Falcone 12	05440-B','Effettuato controlli in località Rimini, Riccione, Mulazzano, Vecciano, Ospedaletto. \r\nGiornata caratterizzata da conizioni climatiche non favorevoli e che hanno mandato a vuoto alcune verifiche preventivate nelle settimane precedenti. Controllato gli occupanti di un appostamento per i quali gli agenti hanno motivo di ritenere che lo  svolgimento dell\'attività venatoria non avvenga in maniera del tutto corretta,  per cui nelle prossime settimane si tornerà a fare ulteriorie approfondite verifiche.','Multipla CZ 816 BP associazione Maricla',120,NULL,'2019-11-02 16:47:55','2019-11-02 16:47:55'),(4498,5501,3,'2019-10-14 14:00:00','2019-10-14 19:00:00',NULL,NULL,'Giovanardi',88,NULL,'2019-11-04 14:59:41','2019-11-04 14:59:41'),(4499,5512,3,'2019-10-03 06:00:00','2019-10-03 11:00:00','inserimento d\'ufficio',NULL,NULL,0,NULL,'2019-11-07 10:11:14','2019-11-07 10:11:14'),(4500,5513,3,'2019-10-10 06:00:00','2019-10-10 11:00:00','inserimento d\'ufficio',NULL,NULL,0,NULL,'2019-11-07 10:13:21','2019-11-07 10:13:21'),(4501,5517,3,'2019-10-13 13:00:00','2019-10-13 18:00:00','inserimento d\'ufficio',NULL,NULL,0,NULL,'2019-11-07 10:14:38','2019-11-07 10:14:38'),(4502,5514,3,'2019-10-17 06:00:00','2019-10-17 11:00:00','inserimento d\'ufficio',NULL,NULL,0,NULL,'2019-11-07 10:15:09','2019-11-07 10:15:09'),(4503,5518,3,'2019-10-19 13:00:00','2019-10-19 18:00:00','inserimento d\'ufficio',NULL,NULL,0,NULL,'2019-11-07 10:15:44','2019-11-07 10:15:44'),(4504,5515,3,'2019-10-05 13:00:00','2019-10-05 18:00:00','inserimento d\'ufficio',NULL,NULL,0,NULL,'2019-11-07 10:16:28','2019-11-07 10:16:28'),(4505,5516,3,'2019-10-12 13:00:00','2019-10-12 18:00:00','inserimento d\'ufficio',NULL,NULL,0,NULL,'2019-11-07 10:17:08','2019-11-07 10:17:08'),(4506,5509,3,'2019-10-09 06:00:00','2019-10-09 12:00:00','inserimento d\'ufficio insieme a nuti vilmo',NULL,NULL,0,NULL,'2019-11-07 10:18:19','2019-11-07 10:18:19'),(4507,5508,3,'2019-10-02 06:00:00','2019-10-02 12:00:00','inserimento d\'ufficio insieme a  nuti vilmo',NULL,NULL,0,NULL,'2019-11-07 10:19:04','2019-11-07 10:19:04'),(4508,5511,2,'2019-10-09 06:00:00','2019-10-09 12:00:00','inserimento d\'ufficio insieme a tomassoni',NULL,NULL,0,NULL,'2019-11-07 10:19:47','2019-11-07 10:19:47'),(4509,5510,2,'2019-10-02 06:00:00','2