to alcune aree a ridosso del torrente Marano, da dove da sempre giungono segnalazioni da parte dei residenti esasperati dalle fucilate dei cacciatori.\r\nNel corso dei controlli individuato un appostamento occupato da due cacciatori nel quale si cacciava con l\'ausilio di preparati tassidermici come richiami della specie storno, non consentiti dalla normativa vigente.\r\nSi precisa che lo scorso anno, anche se diversi erano gli occupanti dello stesso appostamento, furono sanzionati per la stessa tipologia di infrazione.\r\nNella seconda parte della mattinata effettuati alcuni controlli in zona Covignano, sollecitati da alcuni residenti stanchi di sopportare incursioni da parte di cacciatori vaganti attorno le loro abitazioni, pur con una azione tempestiva di intervento giungevamo sul posto quando i cacciatori si erano già allontanati con le prede abbattute.','Multipla asociazione Maricla CZ 816 BP',110,NULL,'2019-11-12 08:16:50','2019-11-12 08:16:50'),(4533,5580,4,'2019-11-09 06:00:00','2019-11-09 11:00:00','Cacciatori controllati:\r\nTeodorani	Ilario	Rimini	06/01/48	Rimini	Via Marecchiese 535/A	456492-O\r\nTeodorani	Stefano	Rimini	15/07/62	Rimini	Via fossalta 8	660957-O\r\nAmati	Andrea	Verucchio	29/12/71	Verucchio	Via Marx 26	247454-O\r\nPezzi	Claudio	San Leo (PU)	26/01/60	Poggio Torriana	Via XXV aprile 9	246926-O\r\nVeroli	Sergio	Verucchio	20/01/50	Rimini	Via Bondeno 7	246107-O','Controlli venatori svolti nei comuni di Rimini, Verucchio, Poggio Torriana, Santarcangelo. Come è prassi del nostro nucleo sono state effettuate una serie di verifiche dal mezzo in dotazione avvalendosi dell\'ausilio dei binocoli, per poi intervenire nei casi in cui necessitavano verifiche più complete o approfondite.\r\nIn nessun caso, di quelli controllati, sono emerse violazioni tali da essere verbalizzate.\r\nBuona presenza di passo di migratori, nello specifico storni, specie cacciata in deroga.','Multipla CZ 816 BP Associazione Maricla',90,NULL,'2019-11-12 08:19:06','2019-11-12 08:19:06'),(4534,5581,4,'2019-11-10 06:00:00','2019-11-10 11:00:00','Cacciatori controllati:\r\nZammarchi	Giorgio	Santarcangelo di R.	09/02/45	Santarcangelo di R.	Via Misano 2	660546-O\r\nBaschetti	Giovanni	Santarcangelo di R.	25/05/41	Santarcangelo di R.	Via Santarcangiolese 2743	819956-O\r\nRaggini	Matteo	Cesena (FC)	20/02/84	Poggio Torriana	Via D. Amedeo Botticelli 37	251867-P\r\nConti	Alessandro	Santarcangelo di R.	28/11/70	Santarcangelo di R.	Via Amendola G. 5	252527-P','Poggio Torriana e Santarcangelo di R. sono stati i comuni principalmente interessati dai controlli nella giornata odierna.\r\nIn comune di Santarcangelo di R., insospettiti da un automezzo in movimento in un campo di erba medica con i fari accesi in orario di oscurità ed in prossimità di un appostamento temporaneo mai smontato e da noi monitorato, ci appostavamo in una fascia vegetazionale per osservare il comportamento del soggetto in attività, raggiunto poi da un secondo cacciatore in un secondo momento.\r\nDurante la fase di nostra osservazione venivamo disturbati nelle operazioni di vigilanza ad opera di un cacciatore, tale Andrea Monaldi, per cui si inoltra separata relazione esaustiva al Comando di Polizia Provinciale.\r\nAlla verifiche dell\'appostamento oggetto della nostra attenzione, si riscontravano alcune violazioni per cui si elevava verbale di contestazione di illecito amministrativo nei confronti dei due occupanti.','Multipla associazione Maricla CZ 816 BP',70,NULL,'2019-11-12 08:22:06','2019-11-12 08:22:06'),(4535,5586,11,'2019-11-09 08:00:00','2019-11-09 11:00:00','inserimento d\'ufficio',NULL,NULL,43,NULL,'2019-11-12 09:57:39','2019-11-12 09:57:39'),(4536,5578,5,'2019-11-10 06:30:00','2019-11-10 13:00:00','tutto regolare','vigilanza venatoria comuni saludecio - Mondaino -gemmano -san clemente -- controllato  1 cacciatore . tutto regolare nulla da segnalare','panda gevfh 272fl',79,NULL,'2019-11-13 15:57:32','2019-11-13 15:57:32'),(4537,5587,3,'2019-09-01 11:04:00','2019-09-01 11:04