ani non è consentito, si giustificava malamente che stava solo facendo fare i bisogni fisiologici al proprio cane, ma subito manifestava l\'intenzione di andarsene. Quindi il tutto si concludeva senza contestazioni ma con un semplice richiamo verbale.','Multipla Associazione Maricla CZ 816 BP',110,NULL,'2020-01-02 10:35:19','2020-01-02 10:35:19'),(4614,5658,8,'2020-01-02 08:00:00','2020-01-02 13:00:00','supporto per piano di controllo su cinghiale Oasi del Conca','nulla da segnalare','fiat panda',10,NULL,'2020-01-02 17:04:21','2020-01-02 17:04:21'),(4615,5657,3,'2019-12-31 09:00:00','2019-12-31 11:00:00',NULL,NULL,'Miani',41,NULL,'2020-01-07 08:23:43','2020-01-07 08:23:43'),(4616,5675,7,'2019-11-07 13:00:00','2019-11-07 17:00:00','inserimento d\'ufficio',NULL,NULL,55,NULL,'2020-01-09 11:35:25','2020-01-09 11:35:25'),(4617,5634,2,'2019-12-14 14:00:00','2019-12-14 18:30:00','inserimento d\'ufficio',NULL,NULL,87,NULL,'2020-01-10 11:48:51','2020-01-10 11:48:51'),(4618,5566,2,'2019-11-10 14:00:00','2019-11-10 19:00:00','inserimento d\'ufficio',NULL,NULL,91,NULL,'2020-01-10 11:49:26','2020-01-10 11:49:26'),(4619,5678,2,'2019-12-01 07:00:00','2019-12-01 14:00:00','inserimento d\'ufficio',NULL,NULL,57,NULL,'2020-01-10 11:50:45','2020-01-10 11:50:45'),(4620,5669,4,'2020-01-05 07:00:00','2020-01-05 13:00:00','Cacciatori controllati:\r\nGiacomini	Luigi	San Leo (PU)	05/02/53	Verucchio	Via Dogana 1390/A	456357-O','Prima parte della mattinata dedicata al controllo del territorio nei comuni di PoggioTorriana e Verucchio, Nel primo comune individuato Della Bartola in cerca del cane perso il giorno precedente durante la caccia al cinghiale e nussun altro cacciatore. Nel secondo comune, dopo una difficile ricerca, individuato un cacciatore in area boschiva intento ad esercitare la caccia ai tordi, non rilevata alcuna violazione. Al termine della mattinata presenziato alla premiazione dei bambini delle scuole presso l\'oasi WWF di Cà Brigida.','Multipla associazione Maricla CZ 816 BP'