Il gruppo Re Bruschi, congiuntamente con Mr. Lombardi dei CCF di Novafeltria, non riscontrato la presenza di Fratino ma alcune impronte, elevate alcune sanzioni per violazione delle normative Covid19 dai CCF in nostra compagnia. Per maggiori informazioni vedasi rapporti gruppo WP Monitoraggio Fratino','Multipla CZ816BP e altre presenti nell\'autorizzazione della Polizia Provinciale',50,NULL,'2020-05-20 09:42:22','2020-05-20 09:42:22'),(4703,5757,4,'2020-04-26 06:30:00','2020-04-26 11:00:00',NULL,'Controlli da parte degli agenti nei punti dove nella giornata precedente erano stati rilevati segnali della presenza del Fratino, non riscontrato nessuna presenza fisica dell\'animale, ma rilevato alcune interessanti specie presenti anche il giorno precedente','Multipla CZ816BP e altre presenti nell\'autorizzazione della Polizia Provinciale',30,NULL,'2020-05-20 09:45:30','2020-05-20 09:45:30'),(4704,5758,4,'2020-04-28 14:00:00','2020-04-28 17:00:00',NULL,'Uscita pomeridiana congiunta con Fabio e Roberta, ornitologi ASOER, per alcune verifiche sulla presenza di fratino e altre specie nel litorale di Igea Marina, non riscontrato nulla in quanto le precipitazioni in atto e il mare mosso non erano le giuste condizioni per poter ottenere i risultati sperati','Multipla CZ816BP',20,NULL,'2020-05-20 09:50:53','2020-05-20 09:50:53'),(4705,5759,4,'2020-05-01 18:30:00','2020-05-01 20:00:00',NULL,'Uscita congiunta con guardie zoofile di Fareambiente nel parco Sacramora a Viserba, dovuta ad una segnalazione a quest\'ultimi da parte di un cittadino il quale asseriva di aver rinvenuto la presenza di uno strano dispositivo nella vegetazione. Il sopralluogo ha consentito di verificare che trattasi di una trappola per avifauna, dopo un periodo di appostamento e dopo aver contattato la Polizia Provinciale e I CCF di Rimini si decideva di rinviare al giorno successivo il prosecuo del controllo.','Multipla CZ816BP',20,NULL,'2020-05-20 09:59:02','2020-05-20 09:59:02'),(4706,5760,4,'2020-05-02 06:30:00','2020-05-02 12:00:00','Per ulteriori informazioni rifarsi alla denuncia di illecito penale stesa in tale occasione e consegnata ai CCF','Appostamento congiunto con guardie zoofile di Fareambiente nel parco Sacramora a Viserba finalizzato ad individuare l\'autore della collocazione del dispositivo di cattura di avifauna nella vegetazione del parco. L\'appostamento dava esito positivo e l\'autore del fatto illecito veniva individuato. Giungevano sul posto due pattuglie dei CCF, con cui si era concordato il giorno prima l\'intervento, e il responsabile veniva denunciato.','Multipla CZ816BP',20,NULL,'2020-05-20 10:04:46','2020-05-20 10:04:46'),(4707,5778,4,'2020-05-09 07:00:00','2020-05-09 11:00:00',NULL,'Controllo sul litorale di Marebello-Miramare dei nidi di Fratino individuati assieme agli ornitologi di ASOER e verifica della corretta nidificazione di rondoni nel sottotetto della scuola Marco Polo di Marebello, a seguito di un post di Facebook apparso il giorno prima che segnalava l\'interdizione dell\'accesso ai nidi dovuto ad un intervento con rete per impedire l\'accesso ai piccioni. Alla verifica di quest\'ultimo caso appariva infondata la notizia in quanto il posizionamento della rete antipiccioni non inpediva ai rondoni di poter accedere ai loro nidi, e risultava comunque di vecchio posizionamento','Multipla CZ816BP',50,NULL,'2020-05-20 10:09:53','2020-05-20 10:09:53'),(4708,5780,4,'2020-05-10 07:00:00','2020-05-10 11:00:00',NULL,'Verifica del litorale di Igea Marina e Bellaria da parte degli agenti, riscontrato alcune specie interessanti ma noin rilevata la presenza del Fratino','Automezzo autorizzato dal provvedimento della Polizia Provinciale',20,NULL,'2020-05-20 10:12:06','2020-05-20 10:12:06'),(4709,5794,3,'2020-05-24 06:00:00','2020-05-24 12:00:00',NULL,NULL,'Miani',121,NULL,'2020-05-25 06:44:28','2020-05-25 06:44:28'),(4710,5793,3,'2020-05-23 06:00:00','2020-05-23 12:00:00',NULL,NULL,'Miani',120,NULL,'2020-05-25 06:44:57','2020-05-25 06:44:57'),